  false,\n\t\"url\": null,\n\t\"notes\": \"Efficiency and effectiveness of aerial
  photograph acquisition by the Region 3 Aviation Program will be improved with use
  of newly purchased upgrades for the Applanix DSS 439 Camera System (Camera System).
  The upgrade components include a 60 mm lens and a gyro-stabilization mount for the
  Camera System. Funding is needed to install these components now. Funding is also
  needed for: 1) software to process digital aerial photograph; and 2) hardware to
  facilitate digital aerial photograph interpretation.\",\n\t\"license_title\": \"License
